import React, { Component } from 'react';
import TaskCard from './TaskCard';

export default class DillyDally extends Component{
  constructor(props){
    super(props)
    this.state = {
      tasks: []
    };
  }

  componentDidMount(){
    fetch('http://localhost:8080/tasks',{
      method:'GET'
    })
    .then(response => response.json())
    .then(data => {
      this.setState({
        tasks: data
      })
    })
    .catch(err => console.log(err));
  }

  render(){
    const taskList = this.state.tasks.map(element => <TaskCard tasks={element} key={element.id}/>)
    return(

      <div>
        <table>
          <thead>
            <th> Task </th>
            <th> Status </th>
            <th> Due By </th>
          </thead>
          <tbody>
            {taskList}
          </tbody>
        </table>
      </div>
    )
  }
}
